import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
    return (
        <>
            <h1 className="App-header" >Home Page</h1>
            <p>
            <Link className="App-link" to="/shoppinglist">Go to the Shopping List Page</Link>
            </p>
            <p>
            <Link className="App-link" to="/storelist">Go to the Store List Page</Link>
            </p>
        </>
    );
}

export default HomePage;
